import React, { useState, useEffect } from "react";
import axios from "axios";
import TeacherSearchingCard from './TeacherSearchingCard';
const StudentContactHistory = (props) => {
  const [teachers, setteachers] = useState([]);
  const [isLoading, SetisLoading] = useState(false);
  
  useEffect(() => {
    SetisLoading(true);
    axios
      .get(`http://localhost:8080/ContactInfo/GetAllContacts?studentID=${localStorage.getItem('personID')}`, {
        headers: {
          Authorization: `Bearer ${localStorage.getItem("jwt")}`,
        },
      })
      .then((res) => {
        SetisLoading(false);
        setteachers(() => { 
          return res.data;
        });
        console.log(res.data);
      })
      .catch((error) => {
        SetisLoading(false);
        console.log(error.response);
      });
  }, []);

  return (
    <div>
      {isLoading && <p>Obtaining data...</p>}
      {!isLoading &&
        teachers.map((teacher) => {
          return (
            <TeacherSearchingCard
              key={teacher.personID}
              teacherID={teacher.personID}
              firstName={teacher.firstName}
              lastName={teacher.lastName}
              email={teacher.email}
              specialization={teacher.specialization}
              history={true}
            />
          );
        })}
    </div>
  );
};

export default StudentContactHistory;
